sys.stdin = io.StringIO(_INPUT)

import sys

input = sys.stdin.readline

n = int(input())
u = [0] * (n - 1)
v = [0] * (n - 1)
for i in range(n - 1):
    u[i], v[i] = map(int, input().split())
visited = [False] * (n + 1)

tree = []
for i in range(n - 1):
    tree.append((u[i], v[i]))

degrees = [0] * (n + 1)
nodes = [set() for _ in range(n + 1)]
for edge in tree:
    degrees[edge[0]] += 1
    degrees[edge[1]] += 1
    nodes[edge[0]].add(edge[1])
    nodes[edge[1]].add(edge[0])


def func(obj_node):
    ad_nodes = nodes[obj_node]
    cnt = 1
    visited[obj_node] = True
    for node in ad_nodes:
        if visited[node]:
            continue
        if degrees[node] == 1:
            cnt += 1
        else:
            cnt += func(node)
    return cnt


del_cnt = [0] * (len(nodes[1]))
visited[1] = True
if degrees[1] == 1:
    print(1)
else:
    for i, node in enumerate(nodes[1]):
        visited[node] = True
        del_cnt[i] = func(node)
    ans = n - max(del_cnt)
    print(ans)
